[13521] = {name = "[q2]配方：超级能量合剂", additional_info = "需要 炼金术 (300)\n[q2]使用: 教你学会配制超级能量合剂。\n超级能量合剂\n需要等级 50\n[q2]使用: 使法术和魔法效果所造成的伤害提高最多150点，持续2 hrs。你在同一时间内只能保有一种合剂的效果，这种效果在死亡后仍可继续存在。 (3秒 冷却)\n需要 梦叶草 (30), 山鼠草 (10), 黑莲花 , 水晶瓶"},
[13522] = {name = "[q2]配方：多重抗性合剂", additional_info = "需要 炼金术 (300)\n[q2]使用: 教你学会配制多重抗性合剂。\n多重抗性合剂\n需要等级 50\n[q2]使用: 使你对所有魔法的抗性提高25点，持续2 hrs。你在同一时间内只能保有一种合剂的效果，但该效果可以和任何提高抗性的法术和物品所提供的效果共存，且在死亡后仍可继续存在。 (3秒 冷却)\n需要 冰盖草 (30), 山鼠草 (10), 黑莲花 , 水晶瓶"},
