[206381] = {name = "[q2]二价圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的胸甲或长袍铭刻过载符文：\n\n\n你的闪电箭、闪电链、治疗链、治疗波和熔岩爆裂法术有50%的几率令你对同一个目标施放第二个完全一样的法术，不需任何法力值消耗，且不产生威胁值，但是伤害或治疗效果减半。\n[q]\"受到自然伤害10次后习得一种新技能。\""},
[206382] = {name = "[q2]风暴圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 20\n[q2]为你的手套铭刻水之护盾符文：\n\n\n施法者被3个水球环绕，每5秒恢复1%的法力值。如果施法者受到了近战、远程或法术伤害，则施法者恢复4%的法力值，并会消耗掉一个水球。每一小段时间内只会有一个水球被激活。效果持续10 min。萨满祭司在同一时间内只能激活一种元素护盾。\n[q]\"用3种不同的元素（自然、冰霜、火焰）命中10名非玩家敌人后习得一种新技能。\""},
[206383] = {name = "[q2]磐石圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的裤子铭刻大地之盾符文：\n\n\n使用一层大地之盾保护目标，使其因受到伤害而损失的施法或引导时间缩短30%，被大地之盾保护的目标在受到攻击时可以恢复[55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]点生命值。该效果每数秒只能生效一次，共可生效9次。大地之盾持续10 min，同一时间内只能给一个目标施放大地之盾，且同一时间内只能有一种元素护盾在同一目标身上生效。\n[q]\"用盾牌格挡20次攻击后习得一种新技能。\""},
[206384] = {name = "[q2]星界圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q]\"用石化武器命中敌人25次后习得一种新技能。\""},
[206385] = {name = "[q2]屑岩圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的裤子铭刻土之道符文：\n\n\n主手武器激活石化武器且装备盾牌时，你产生的威胁值提高50%，生命值提高30%，受到的伤害降低10%，受到近战攻击爆击的几率降低6%，大地震击会嘲讽目标并使其攻击你，并且与其他震击法术具有独立的冷却时间，但范围缩短为近战。\n[q]\"用大地震击击败20名敌人后习得一种新技能。\""},
[206386] = {name = "[q2]镀电圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的胸甲或长袍铭刻盾牌精通符文：\n\n\n每当你格挡时，恢复最大法力值的8%，并提高护甲值，数值相当于盾牌护甲值的30%，最多可叠加5次。你的格挡几率提高10%，格挡值提高15%。\n[q]\"用闪电箭击败敌人10次后习得一种新技能。\""},
[206387] = {name = "[q2]卡亚圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n[q2]为你的手套铭刻熔岩爆裂符文：\n\n\n向目标投掷熔岩，造成[469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]到[605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)]点火焰伤害。如果目标身上有你施加的烈焰震击效果，熔岩爆裂则会爆击。\n[q]\"受到岩浆伤害5次后习得一种新技能。（降低部分岩浆来源造成的伤害）\""},
[206388] = {name = "[q2]硫息圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的手套铭刻熔火爆裂符文：\n\n\n冲击你面前锥形范围内的最多4名敌人，造成[(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power]到[(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power]点火焰伤害。该技能会产生大量威胁值。烈焰震击的周期性伤害有10%的几率重置熔火爆裂的冷却时间。\n[q]\"用大地震击击败10名敌人后习得一种新技能。\""},
[206389] = {name = "[q2]硫磺圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的腰带铭刻火焰新星符文：\n\n\n将你的火焰新星图腾法术替换为火焰新星，使你当前的火焰图腾在其位置造成伤害。\n[q]\"用石化武器命中敌人25次后习得一种新技能。\""},
