[206391] = {name = "[q2]朔望圣像", additional_info = "拾取后绑定\n唯一\n圣物 图腾\n职业： 萨满\n需要等级 3\n[q2]为你的护腕铭刻激流\n 符文：\n\n\n为一个友方单位恢复[113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]到[123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]点生命值，并在15 sec内继续恢复总计[5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)]点生命值。在15 sec内，你对该目标直接施放的下一个治疗链将会消耗这个持续治疗效果，并使治疗链的效果提高25%。该法术也会触发先祖复苏。\n[q]\"用石化武器命中敌人25次后习得一种新技能。\""},
