[206954] = {name = "[q2]怒熊神像", additional_info = "拾取后绑定\n唯一\n圣物 偶像\n职业： 德鲁伊\n需要等级 10\n[q2]为你的手套铭刻割碎符文：\n\n\n割碎目标躯体，造成160%的普通伤害，并使流血效果和撕碎对其造成的伤害提高30%，效果持续1 min。所有影响爪击、槌击或由二者触发的效果都可对该技能生效。\n[q]\"熊形态的怒气值保持在50或以上持续60秒后习得一种新技能。\""},
[206963] = {name = "[q2]自然潜能符文", additional_info = "拾取后绑定\n唯一\n职业： 德鲁伊\n[q2]为你的胸甲或长袍铭刻生命之种符文：\n\n\n当你的任意非周期性治疗法术爆击之后，在目标身上植入一枚生命之种。该目标下一次受到伤害或非持续治疗时，生命之种会绽放，为其恢复生命值，数值相当于之前那次治疗法术治疗量的50%。生命之种持续15 sec。\n[q]\"使你学会一种新的铭刻技能。\""},
