[206985] = {name = "[q2]头狼的回响", additional_info = "拾取后绑定\n唯一\n职业： 萨满\n需要等级 3\n[q2]为你的靴子铭刻头狼之魂符文：\n\n\n为目标注入头狼的灵魂，使其产生的所有威胁值提高45%，持续30 min。最多1个目标。如果对除自己外的目标使用，则萨满祭司还会获得副狼忠随，使造成的额物理伤害提高5%，产生的所有威胁值降低30%持续30 min。目标无法同时拥有头狼之魂和副狼忠随效果。\n[q]\"习得一种新技能。\""},
[206989] = {name = "[q2]日灼符文", additional_info = "拾取后绑定\n唯一\n职业： 德鲁伊\n[q2]为你的手套铭刻阳炎术符文：\n\n\n灼烧敌人，对其造成[130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]到[152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害，并在12 sec内造成额外的[65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害。\n\n 同时，在熊形态、猎豹形态或巨熊形态下，将你的月火术替换成阳炎术（熊）或阳炎术（豹）。所有影响月火术或由其触发的效果都可对该法术生效。\n\n 阳炎术（熊）\n灼烧敌人，对其造成[130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]到[152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害，并在12 sec内造成额外的[65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害。\n\n 阳炎术（豹）\n灼烧敌人，对其造成[130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]到[152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害，并在12 sec内造成额外的[65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100]点自然伤害。奖励1个连击点数。\n[q]\"使你学会一种新的铭刻技能。\""},
