[210252] = {name = "[q2]毒刃符文", additional_info = "拾取后绑定\n唯一\n职业： 潜行者\n[q2]为你的手套铭刻毒刃符文：\n\n\n立即用副手武器进行攻击，造成通常的副手武器伤害，有100%的几率对目标施加副手武器的毒药。武器攻击速度越慢，消耗的能量越多。奖励1个连击点数。\n\n 所有影响邪恶攻击或由其触发的天赋和效果都可以对毒刃生效。\n[q]\"使你学会一种新的铭刻技能。\""},
