[210322] = {name = "[q2]毒伤符文", additional_info = "拾取后绑定\n唯一\n职业： 潜行者\n[q2]为你的裤子铭刻毒伤符文：\n\n\n终结技，根据你施放在目标身上的致命毒药效果，立即对其造成中毒伤害。使用毒伤技能之后，你对目标施加速效毒药的频率提高75%。这个效果持续1秒，每个连击点数可以使其延长1秒。每个连击点数激活一层效果：\n 1层：[((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09]点伤害\n 2层：[((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18]点伤害\n 3层：[((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27]点伤害\n 4层：[((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36]点伤害\n 5层：[((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45]点伤害\n[q]\"使你学会一种新的铭刻技能。\""},
