[210822] = {name = "[q2]祥和顿悟", additional_info = "拾取后绑定\n唯一\n职业： 牧师\n[q2]为你的胸甲或长袍铭刻妙手回春符文：\n\n\n快速治疗使你的下一个次级治疗术、治疗术、强效治疗术或治疗祷言的施法时间缩短20%，持续20 sec，最多可叠加3次。\n[q]\"习得一种新的铭刻技能。\""},
[210823] = {name = "[q2]双武器专精符文", additional_info = "拾取后绑定\n唯一\n职业： 萨满\n[q2]为你的胸甲或长袍铭刻双武器专精符文：\n\n\n双持武器时，你的法术和近战攻击命中率提高10%，你的风暴打击技能现在会使用两把武器发动打击，并使你副手武器造成的伤害提高50%。\n[q]\"使你学会一种新的铭刻技能。\""},
[210824] = {name = "[q2]契约符文", additional_info = "拾取后绑定\n唯一\n职业： 术士\n[q2]为你的裤子铭刻恶魔契约符文：\n\n\n你的宠物的爆击会对小队成员施加恶魔契约，持续45 sec。恶魔契约使造成的法术伤害和治疗效果提高( 60 / 2)点，或者提高相当于你法术伤害的10%，取两者中较高者。无法对被征服的恶魔生效。\n[q]\"使你学会一种新的铭刻技能。\""},
