[210980] = {name = "[q2]恶魔变形符文", additional_info = "拾取后绑定\n唯一\n职业： 术士\n[q2]为你的手套铭刻恶魔变形符文：\n\n\n变形为一个恶魔，使护甲值提高500%，受到爆击的几率降低6%，产生的威胁值提高50%，通过生命分流获得的法力值提高100%，改变一部分技能的作用，并获得新技能：\n\n 灼热之痛：变为瞬发。\n\n 暗影箭：变为暗影顺劈，暗影系近战攻击，可以击中周围最多3个敌人，但具有6秒冷却时间。\n\n 恐惧：替换为威吓。\n\n\n嘲讽目标，使其向你发起攻击，但是对已经在攻击你的目标无效。\n\n 恶魔冲锋\n\n\n向敌人冲锋，使其昏迷1 sec。无法在战斗中使用。\n\n 恶魔嚎叫\n\n\n嘲讽附近的所有敌人，强制它们攻击你，持续6 sec。\n[q]\"使你学会一种新的铭刻技能。\""},
